import Header from '../components/menu/menu.component'
import Footer from '../components/footer/footer.component'

import Tash from '../assets/Tash.jpg'

const Om = (props) => {
    const { posts = [] } = props
    return (
        <div>
            <Header />
            <h1>Om</h1>
            <div>
                <img 
                    className={styles.profileImage}
                    src={Tash} 
                />
            </div>
            <Footer />
        </div>
    )
}

export default Om
